import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Board extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p id="welcome">Welcome to the Food App</p>

        </header>
      </div>
    );
  }
}

class App extends Component {
  render() {
    return (
      <div>
        <Board />
      </div>
    );
  }
}

export default App;
